import React, { useState, useRef, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Webcam from "react-webcam";
import * as faceapi from 'face-api.js';
import "./Auth.css";

const Login = () => {
    const navigate = useNavigate();
    const webcamRef = useRef(null);

    const [formData, setFormData] = useState({
        email: "",
        password: "",
        otp: ""
    });

    const [showOtp, setShowOtp] = useState(false);
    const [useFaceAuth, setUseFaceAuth] = useState(false);
    const [faceDetected, setFaceDetected] = useState(false);
    const [isLoading, setIsLoading] = useState(false);
    const [error, setError] = useState("");
    const [otpSent, setOtpSent] = useState(false);
    const [otpVerified, setOtpVerified] = useState(false);

    // Simulate OTP generation
    const generateOTP = () => {
        return Math.floor(100000 + Math.random() * 900000).toString();
    };

    const requestOtp = async () => {
        if (!formData.email) {
            setError("Please enter your email first");
            return;
        }

        setIsLoading(true);
        try {
            // Simulate API call
            const generatedOtp = generateOTP();

            // In a real application, this would be an API call
            // For demo purposes, we'll store the OTP in localStorage
            localStorage.setItem('currentOtp', generatedOtp);

            // Simulate API delay
            await new Promise(resolve => setTimeout(resolve, 1000));

            // Show OTP in console for testing purposes
            console.log('Generated OTP:', generatedOtp);

            setShowOtp(true);
            setOtpSent(true);
            setError("");
            alert(`OTP has been generated (check console). In a real application, this would be sent to ${formData.email}`);

        } catch (error) {
            setError("Failed to send OTP. Please try again.");
        } finally {
            setIsLoading(false);
        }
    };

    const verifyOtp = (inputOtp) => {
        const storedOtp = localStorage.getItem('currentOtp');
        return inputOtp === storedOtp;
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });

        // Verify OTP as user types
        if (name === 'otp' && value.length === 6) {
            if (verifyOtp(value)) {
                setOtpVerified(true);
                setError("");
            } else {
                setOtpVerified(false);
                setError("Invalid OTP");
            }
        }

        setError(""); // Clear any previous errors
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setIsLoading(true);
        setError("");

        try {
            // Basic validation
            if (!formData.email || !formData.password) {
                throw new Error("Please fill in all required fields");
            }

            if (showOtp && !otpVerified) {
                throw new Error("Please enter valid OTP");
            }

            // Simulate successful login
            await new Promise(resolve => setTimeout(resolve, 1000));

            // Clear OTP from storage
            localStorage.removeItem('currentOtp');

            // Navigate to dashboard
            navigate("/dashboard");

        } catch (error) {
            setError(error.message || "Login failed. Please try again.");
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <div className="auth-container">
            <div className="auth-card">
                <h2>Login</h2>
                {error && <div className="error-message">{error}</div>}
                <form onSubmit={handleSubmit}>
                    <div className="form-group">
                        <label htmlFor="email">Email</label>
                        <input
                            type="email"
                            id="email"
                            name="email"
                            placeholder="Enter your email"
                            value={formData.email}
                            onChange={handleInputChange}
                            disabled={isLoading}
                        />
                    </div>
                    <div className="form-group">
                        <label htmlFor="password">Password</label>
                        <input
                            type="password"
                            id="password"
                            name="password"
                            placeholder="Enter your password"
                            value={formData.password}
                            onChange={handleInputChange}
                            disabled={isLoading}
                        />
                    </div>

                    {!showOtp && (
                        <button
                            type="button"
                            className="auth-button secondary"
                            onClick={requestOtp}
                            disabled={!formData.email || isLoading}
                        >
                            {isLoading ? "Sending..." : "Send OTP"}
                        </button>
                    )}

                    {showOtp && (
                        <div className="form-group">
                            <label htmlFor="otp">OTP</label>
                            <input
                                type="text"
                                id="otp"
                                name="otp"
                                placeholder="Enter 6-digit OTP"
                                value={formData.otp}
                                onChange={handleInputChange}
                                disabled={isLoading}
                                maxLength={6}
                            />
                            {otpVerified && (
                                <div className="success-message">OTP Verified âœ“</div>
                            )}
                            <button
                                type="button"
                                className="link-button"
                                onClick={requestOtp}
                                disabled={isLoading}
                            >
                                Resend OTP
                            </button>
                        </div>
                    )}

                    <button
                        className="auth-button"
                        type="submit"
                        disabled={isLoading || (showOtp && !otpVerified)}
                    >
                        {isLoading ? "Logging in..." : "Login"}
                    </button>
                </form>
                <button
                    className="link-button"
                    onClick={() => navigate("/signup")}
                    disabled={isLoading}
                >
                    Don't have an account? Sign Up
                </button>
            </div>
        </div>
    );
};

export default Login;
